/;","INSERT INTO `pages` VALUES (1,'Home','Vortex Roleplay is an amazing server, it is powered by the vxrp2 script and UCP, the UCP produced by Frederick Wright with designs from Peter Wright, and the script produced by Frederick Wright and Stefan Rosic.\u003cbr /\u003e\u003cbr /\u003eI can\\'t wait to meet you \u003cbr /\u003e And I know and I know \u003cbr /\u003e I\\'ll have to learn how to teach you \u003cbr /\u003e I need to let the fool in me go \u003cbr /\u003e I\\'m gonna work like crazy \u003cbr /\u003e Give you everything you need \u003cbr /\u003e Build the world that you will see \u003cbr /\u003e I will see you soon \u003cbr /\u003e I will be waiting at the other end \u003cbr /\u003e Take your time coming through \u003cbr /\u003e You will never have to this again \u003cbr /\u003e I will show you them all \u003cbr /\u003e Lessons I\\'ve learned will have to guide \u003cbr /\u003e I\\'ll come running when you call \u003cbr /\u003e But for now, just stay inside \u003cbr /\u003e',1,1321669061,1321669061,''),(2,'About Us','This community is based on the roleplaying mode in SA-MP, there\\'s a UCP (this) and a SA-MP server which run in conjunction with each other to deliver a dynamic, entertaining and generally great experience. \u003cbr /\u003e\u003cbr /\u003eThis community is powered by the vxrp2 package\u0026mdash;which includes the UCP and SA-MP server script.',1,1321673299,1321678392,''),(3,'Statistics','Here\\'s a few of the most significant statistics we have on record:\u003cbr /\u003e\u003cbr /\u003e',1,1321678751,1321678751,'stats'),(4,'Server Information','127.0.0.1:7777',1,1321750275,1321750275,''),(5,'Staff Roster','Here\\'s a list of the special people that help us run this community on a daily basis\u0026mdash;they contribute their time, money and mental health to keeping this community a great place.\u003cbr /\u003e\u003cbr /\u003e',1,1321750395,1321750395,'staff'),(6,'Logout','You\\'ve now logged out. \u003cbr /\u003e\u003cbr /\u003eThanks for stopping by!',1,1321759357,1321759357,'logout'),(7,'Password Recovery','You can use this page to recover your password.',1,1321760418,1321760418,'recovery'),(8,'Login','You can login from this page.',1,1321760513,1321760513,'login'),(9,'FAQ','Here\\'s a short FAQ covering the basics of the UCP. If you\\'re confused, this is the place to visit.\u003cbr /\u003e\u003cbr /\u003e\u003cb\u003eHow do I login?\u003c/b\u003e\u003cbr /\u003eThe login box positioned at the top right allows you to login with your in-game username and password.',1,1321940685,1321940685,'');","/*!40000 ALTER TABLE `pages` ENABLE KEYS */;","UNLOCK TABLES;","","--","-- Table structure for table `phonecontacts`","--","","DROP TABLE IF EXISTS `phonecontacts`;","/*!40101 SET @saved_cs_client     = @@character_set_client */;","/*!40101 SET character_set_client = utf8 */;","CREATE TABLE `phonecontacts` (","  `contactID` int(32) NOT NULL AUTO_INCREMENT,","  `contactAdded` int(32) NOT NULL,","  `contactAddee` int(32) NOT NULL,","  `contactName` varchar(24) NOT NULL,","  PRIMARY KEY (`contactID`)",") ENGINE=MyISAM DEFAULT CHARSET=latin1;","/*!40101 SET character_set_client = @saved_cs_client */;","","--","-- Dumping data for table `phonecontacts`","--","","LOCK TABLES `phonecontacts` WRITE;","/*!40000 ALTER TABLE `phonecontacts` DISABLE KEYS */;","/*!40000 ALTER TABLE `phonecontacts` ENABLE KEYS */;","UNLOCK TABLES;","","--","-- Table structure for table `phonelogs`","--","","DROP TABLE IF EXISTS `phonelogs`;","/*!40101 SET @saved_cs_client     = @@character_set_client */;","/*!40101 SET character_set_client = utf8 */;","CREATE TABLE `phonelogs` (","  `logID` int(32) NOT NULL AUTO_INCREMENT,","  `phoneNumber` int(32) NOT NULL,","  `phoneName` varchar(24) NOT NULL,","  `phoneAction` varchar(768) NOT NULL,","  PRIMARY KEY (`logID`)",") ENGINE=MyISAM DEFAULT CHARSET=latin1;","/*!40101 SET character_set_client = @saved_cs_client */;","","--","-- Dumping data for table `phonelogs`","--","","LOCK TABLES `phonelogs